import React from 'react';
import './App.css';
import Technologies from "./Technologies";

function App() {
    return (
        <div className="App">
            <Header/>
            <Technologies/>
        </div>
    );
}

const Header = () => {
    return (
        <div>
            <a href="#">Home</a>
            <a href="#">News Feed</a>
            <a href="#">Messages</a>
        </div>
    )
}


export default App;
